function dataGraphicValueXAge(param) {
    var valueXAge = null;
    if (param.value && param.age && param.value[0] && param.age[0] && param.value.length === param.age.length) {
        valueXAge = {
            data: {
                'LINEAS': [],
                'state': true
            },
            conf: {
                'Tittle': param.title,
                'Xtittle': param.xTitle,
                'Ytittle': param.yTitle,
                'scale': param.scale || 1,
                'Xlabels': [],
                'state': true
            }
        };
        var data = null;
        $.each(param.age, function (index, age) {
            param.age[index] = age - (age % 1);
        });
        // 0 male, 1 female
        var sex = param.sex === '0' ? 'boy' : 'girl';
        data = param.age[0] <= 24 ? param.dataValues[sex].two : param.age[0] <= 60 ? param.dataValues[sex].five : param.dataValues[sex].eighteen;
        if (data) {
            valueXAge.conf.Xlabels = [];
            var lines = [{item: 'zero', label: '0', rgb: {r: '158', g: '247', b: '125'}},
                {item: 'negativeOne', label: '-1', rgb: {r: '255', g: '255', b: '0'}},
                {item: 'positiveOne', label: '+1', rgb: {r: '255', g: '255', b: '0'}},
                {item: 'negativeTwo', label: '-2', rgb: {r: '250', g: '167', b: '140'}},
                {item: 'positiveTwo', label: '+2', rgb: {r: '250', g: '167', b: '140'}},
                {item: 'negativeThree', label: '-3', rgb: {r: '99', g: '99', b: '112'}},
                {item: 'positiveThree', label: '+3', rgb: {r: '99', g: '99', b: '112'}}];
            valueXAge.data['LINEAS'].push({'area': false, 'label': 'Paciente', 'dataR': [], 'colorR': '0', 'colorG': '0', 'colorB': '255', 'colorBR': '0', 'colorBG': '0', 'colorBB': '255'});
            $.each(lines, function (index, line) {
                if (data[line.item]) {
                    valueXAge.data['LINEAS'].push({'area': false, 'label': line.label, 'dataR': [], 'colorR': line.rgb.r, 'colorG': line.rgb.g, 'colorB': line.rgb.b, 'colorBR': line.rgb.r, 'colorBG': line.rgb.g, 'colorBB': line.rgb.b});
                }
            });
            $.each(data.xLabels, function (index, x) {
                var label = (x > 0 && x % 12 === 0) ? (x / 12) + ' Año(s)' : String(x);
                valueXAge.conf.Xlabels.push(label);
                var notFound = true;
                $.each(param.age, function (index1, age) {
                    if (x === age) {
                        valueXAge.data['LINEAS'][0].dataR.push({x: x, y: param.value[index1]});
                        notFound = false;
                        return;
                    }
                });
                if(notFound){
                    valueXAge.data['LINEAS'][0].dataR.push({x: x, y: null});
                }
                $.each(lines, function (index1, line) {
                    if (data[line.item]) {
                        valueXAge.data['LINEAS'][index1 + 1].dataR.push({x: x, y: data[line.item][index]});
                    }
                });
            });
        }
    }
    return valueXAge;
}


